column6:
Thank you for repeating the excatly same message to me as you did a
couple of weeks ago.
The answer is the same as last time, details was part of original
message. I do not have other details.
Please locate my order via either my mail address or the details in the
original mail (Order 1291).
If you are not able to do this, please get a grown-up to help you-
If you fail to comply, i will contact the authorities and report this
as a fradulent scam.
/Mike
